*Подходит для интровертов😉

Сочи- сокровищница дач. Что-то сваяли до революци, но не столь много, раньше славный город всегда был номером два после заветного Крыма. 
💎В сталинском ампире построена дача писателя Николая Островского. Холмистый, очень ухоженный сад с тропинками, увлеченные экскурсоводы, что расскажут об истории Сочи, проведут индивидуальную экскурсию и внушат любовь к этому краю
💎 Дача оперной певицы Валерии Барсовой, народной артистки.Она пела с Шаляпиным, между прочим.
Вот уж Примадонна знала толк! Два шага из дома- и ты на пляже. 
Ухоженная территория музея, пальмы, зелёные ажурные коридоры из винограда....😍
Ставят пластинку с ее исполнением.
💎 Дом-дача А.В.Якобсона
А это наш любимый модерн начала века, и что-то романтично-воздушное, из чего дача превращается в маленький замок.
Теперь это санаторий Светлана, и к ним так просто не заберёшься, огорожено забором. Но при определенных навыках...😎😏
Когда-то здесь был санаторий для работников искусства и Маяковский впервые публично прочитал Стихи о советском паспорте. 

Знаете, количество зелени во всём городе и в садиках при дачах и виллах покоряет, сидишь в самый зной в тени, дышишь этим, а под вечер...Словами не передать. Съездите, почувствуйте сами эту негу, ведь Сочи- это точно кусочек рая.

